import '../styles/storyTop.scss'
import katrinakaif from '../assets/story/katrinakaif.jpg'
import kritisanon from '../assets/story/kritisanon.jpg'


function StoryTop(){
    const storiesData = [
        {
            img:katrinakaif,
            name:'Katrinakaif'
        },{
            img:kritisanon,
            name:"Kritisanaon"
        }
    ]
    return(
        <div className='stories'>
            <div className="story">
                {
                    storiesData.map((data, index)=>(
                        // <div className="profiles" key={index}>
                        //     <div className="imgborder">
                        //         <img src={data.img} alt="" />
                        //     </div>
                        //     <p>{data.name}</p>
                        // </div>
                        <div key={index}>
                            <profileStory img={data.img} name= {data.name}/>
                        </div>
                    ))
                }
            </div>
        </div>
    )
}

export function profileStory({img, name}){
    return (
        <div id="profiles">
            <div className="imgborder">
                <img src={img} alt="" />
            </div>
            <p>{name}</p>
        </div>
    )
}
export default StoryTop;
